export const getServerSideProps: GetServerSideProps = async (ctx) => {
	const { ["creapp.token"]: token, ["creapp.user"]: rnp } = parseCookies(ctx);

	if (!token) {
		return {
			redirect: {
				destination: "/login",
				permanent: false,
			},
		};
	}

	const card = await getCard(rnp);
	const profissional = await getProfissional(rnp);
	const imagens = await getImage(rnp);

	const carteira = card;

	return {
		props: {
			carteira,
			profissional,
			imagens,
		},
	};
};
